import React from "react";
import Logo from "../Images/Logo-hois.svg";
import styled from "styled-components";

const Nav = () => {
  return (
    <NavBar>
     <div>
        <img src={Logo} alt="Mainlogo" />
        <Input />
     </div>
    </NavBar>
  );
};

const NavBar = styled.nav``;
const Input = styled.input``;
export default Nav;
